def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.1:
            priorities[i] = 1 / (1 + np.exp(-35 * (ratio - 0.1))) + 0.1
        elif ratio >= 0.1 and ratio < 0.4: 
            priorities[i] = 1 / (1 + np.exp(-20 * (ratio - 0.3))) + 0.3
        elif ratio >= 0.4 and ratio < 0.6:
            priorities[i] = 1 / (1 + np.exp(-12 * (ratio - 0.5))) + 0.5
        elif ratio >= 0.6 and ratio < 0.8:
            priorities[i] = 1 / (1 + np.exp(-8 * (ratio - 0.7))) + 0.6
        else:
            priorities[i] = 1 / (1 + np.exp(-5 * (ratio - 1))) + 0.7

        if i % 5 == 0:
            priorities[i] += 0.2
        else:
            for j in range(5):
                if i % (j + 2) == 0:
                    priorities[i] -= 0.04 * j
                elif i % (j + 3) == 0:
                    priorities[i] += 0.06 * j
                else:
                    priorities[i] += 0.03 * j

            if i % 2 == 0:
                priorities[i] *= 1.7
            else:
                priorities[i] += 0.4

    return priorities
